import styles from './Home.module.css'
import posts from 'json/posts.json'
import Post from 'Components/Posts/Post'

const Home = () => {
  return (
    <ul className={styles.posts}>
      {posts.map((post) => (
        <li key={post.id}>
          <Post
            post={post}
          />
        </li>
      ))}
    </ul>

  )
}

export default Home
